import React from 'react';
import { Code, PenTool, Briefcase, Database, Cpu, TrendingUp, Music, BookOpen } from 'lucide-react';

const CategoryCard = ({ icon, title, courseCount, color }) => {
  return (
    <div className="bg-white rounded-lg shadow-md hover:shadow-lg transition-shadow duration-300 overflow-hidden">
      <div className={`h-2 ${color}`}></div>
      <div className="p-6">
        <div className={`inline-flex items-center justify-center w-12 h-12 rounded-full ${color.replace('bg-', 'bg-').replace('600', '100')} mb-4`}>
          <div className={color.replace('bg-', 'text-').replace('600', '600')}>{icon}</div>
        </div>
        <h3 className="text-lg font-bold text-gray-900 mb-1">{title}</h3>
        <p className="text-gray-600 text-sm">{courseCount} courses</p>
      </div>
    </div>
  );
};

const TopCategories = () => {
  const categories = [
    {
      id: 1,
      icon: <Code className="h-6 w-6" />,
      title: "Programming & Development",
      courseCount: 425,
      color: "bg-blue-600"
    },
    {
      id: 2,
      icon: <PenTool className="h-6 w-6" />,
      title: "Design & Creativity",
      courseCount: 310,
      color: "bg-purple-600"
    },
    {
      id: 3,
      icon: <Briefcase className="h-6 w-6" />,
      title: "Business & Management",
      courseCount: 280,
      color: "bg-yellow-600"
    },
    {
      id: 4,
      icon: <Database className="h-6 w-6" />,
      title: "Data Science & Analytics",
      courseCount: 250,
      color: "bg-green-600"
    },
    {
      id: 5,
      icon: <Cpu className="h-6 w-6" />,
      title: "Artificial Intelligence",
      courseCount: 180,
      color: "bg-red-600"
    },
    {
      id: 6,
      icon: <TrendingUp className="h-6 w-6" />,
      title: "Marketing & Digital Media",
      courseCount: 210,
      color: "bg-orange-600"
    },
    {
      id: 7,
      icon: <Music className="h-6 w-6" />,
      title: "Music & Audio Production",
      courseCount: 150,
      color: "bg-pink-600"
    },
    {
      id: 8,
      icon: <BookOpen className="h-6 w-6" />,
      title: "Language & Humanities",
      courseCount: 195,
      color: "bg-teal-600"
    }
  ];

  return (
    <section className="py-16 bg-gray-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="text-center mb-12">
          <h2 className="text-3xl font-bold text-gray-900">Top Categories</h2>
          <p className="mt-4 text-lg text-gray-600 max-w-3xl mx-auto">
            Explore our most popular categories and find the perfect course for you
          </p>
        </div>

        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6">
          {categories.map((category) => (
            <CategoryCard key={category.id} {...category} />
          ))}
        </div>

        <div className="mt-12 text-center">
          <a href="#" className="inline-flex items-center text-teal-600 hover:text-teal-700 font-medium">
            View All Categories
            <svg className="ml-2 w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M14 5l7 7m0 0l-7 7m7-7H3" />
            </svg>
          </a>
        </div>
      </div>
    </section>
  );
};

export default TopCategories;
